import React from 'react';
import Board from './components/Board';

function App() {

  return (  
    <div className="App">
      <h1 className="header">TIC TAC TOE</h1>
      <Board />
    </div>
  );

  function Refresh() {

    function refreshPage() {
      window.location.reload(false);
    }

    return (
      <div>
        <button onClick={refreshPage}>Click to reload!</button>
      </div>
    );
  }
}


export default App;
